    int valor = 0;

    public void Borrar()
    {

        using (VacunateRDContext con = new VacunateRDContext())
        {
            con.Vacunados.RemoveRange(con.Vacunados.Where(x => x.Id == int.Parse (elegir)));
            con.SaveChanges();
            valor = 1;
        }


    }

    

